import React, { Component } from "react";

type MainState = {
  title: string; // title of this main page
  videos: {
    // array of video objects to be displayed in VideoTiles
    thumbnailURI: string;
    title: string;
    artist: string;
    views: number;
    uploaded: string;
  }[];
};

type MainProps = {
  title: string; // title of this main page
  videos: {
    // array of video objects to be displayed in VideoTiles
    thumbnailURI: string;
    title: string;
    artist: string;
    views: number;
    uploaded: string;
  }[];
};

export default class Main extends Component<MainProps, MainState> {
  state: MainState = {
    title: "",
    videos: [],
  };

  render() {
    return <div></div>;
  }
}
